import React from "react";

export default class ParkList extends React.Component {
    state = {
        loading: true,
        Allparks: [],
    };

    async componentDidMount() {
        const url = "https://developer.nps.gov/api/v1/parks?&api_key=gUeSemHr93mXuKE5WqakVIaO2cDN67aqXettWyDE";
        const response = await fetch(url);
        const data = await response.json();
        this.setState({ Allparks: data.data, loading: false });
    }

    render() {
        return (
            <div>
               {this.state.loading || !this.state.Allparks ? (<div>loading... </div>
               ) : (
                    <div>
                        <div>{this.state.Allparks.map(park => <div>{park.fullName}</div>)}</div>
                    </div>
                )}
            </div>
        )

   }
}
